function Footer() {
  return (
    <footer className="bg-light text-center text-lg-start mt-5">
      <div className="text-center p-3" style={{ backgroundColor: '#f1f1f1' }}>
        © {new Date().getFullYear()} Asiru — Travel & Skill Sharing Platform
      </div>
    </footer>
  );
}

export default Footer;
